import { MdSearch } from "react-icons/md";

const Search = ({handleSearch}) => {
  return (
    <div className="search">
      <MdSearch className="search-icons" size="1.3em"></MdSearch>
      <input
        type="text"
        placeholder="type to search..."
        onChange={handleSearch}
      />
    </div>
  );
};

export default Search;
